<script lang="ts">
    import { easeIn } from "motion";

    $effect(() => {
        const handleScroll = () => {
            const { top } = document
                .getElementById("workflow")!
                .getBoundingClientRect();

            const getProgress = (offsetScale: number) => {
                const offset = offsetScale * window.innerHeight;
                return Math.max(
                    Math.min(
                        (window.innerHeight - top - offset) /
                            ((window.innerHeight - offset) * 0.1),
                        1,
                    ),
                    0,
                );
            };

            document
                .getElementById("job1")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.1)).toString(),
                );

            document
                .getElementById("job1Shadow")
                ?.setAttribute(
                    "stdDeviation",
                    (easeIn(getProgress(0.1)) * 3).toString(),
                );

            document
                .getElementById("path1")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.2)).toString(),
                );
            document
                .getElementById("job2")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.3)).toString(),
                );

            document
                .getElementById("job2Shadow")
                ?.setAttribute(
                    "stdDeviation",
                    (easeIn(getProgress(0.3)) * 3).toString(),
                );

            document
                .getElementById("path2")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.4)).toString(),
                );

            document
                .getElementById("job3")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.5)).toString(),
                );

            document
                .getElementById("job3Shadow")
                ?.setAttribute(
                    "stdDeviation",
                    (easeIn(getProgress(0.5)) * 3).toString(),
                );

            document
                .getElementById("path3")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.6)).toString(),
                );

            document
                .getElementById("job4")
                ?.setAttribute(
                    "stroke-opacity",
                    easeIn(getProgress(0.7)).toString(),
                );

            document
                .getElementById("job4Shadow")
                ?.setAttribute(
                    "stdDeviation",
                    (easeIn(getProgress(0.7)) * 3).toString(),
                );
        };

        addEventListener("scroll", handleScroll);

        handleScroll();

        return () => {
            removeEventListener("scroll", handleScroll);
        };
    });
</script>

